import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import potn_logo from "./potn_logo.jpg";
import "./index.css";

export default function POTNLogo() {
  return (
    <div className="container">
      <img src={potn_logo} style={{ flexGrow: '1'}}></img>
    </div>
  );
}
